import React from "react";
import './contacts.css';
import img from '../../images/contact.svg';

export default function Contacts(){
    return(
        <>
        <div className="contacts" id="contacts">
            <div className="left">
                <img src={img} alt="" />
            </div>
            <div className="right">

            </div>
        </div>
        </>
    );
}
